window.bookSummaryJSON = "<p>Once upon a time, in a parallel universe, there existed the continent of Triton....</p> <p>The queen has been assassinated. The Enchantments are under attack. The plot is unfolding. And our lovers, Silence and Mars, Cassius and Elena, True and Farah, and Aramus and Ha-Lah, are forced to separate as treachery and civil war sweep Triton.</p> <p>Not to mention, the Beast is still a threat to every breathing being on the continent, and it is the destined warriors and witches who must stop him.</p> <p>The attention of the fated mates is scattered and weighed down with bereavement and heartbreak as some leave Wodell to go to Airen, Mar-el and Firenze.</p> <p>But they must amass their powers....</p> <p><b>The Beast is rising.</b></p>"; 
